[CmdletBinding()]
Param(
    [bool]$SurnameFirst = $false,
    [string]$ExternalMarker = "Ext"
)

#Reading configuration
. $PSScriptRoot\..\..\01_ConfigureEnv.ps1

#Starting Transscript
Start-Transcript -Path "$($AlyaLogs)\scripts\aad\Prepare-GuestUsers-$($AlyaTimeString).log" | Out-Null

# Checking modules
Write-Host "Checking modules" -ForegroundColor $CommandInfo
Install-ModuleIfNotInstalled "Microsoft.Graph.Authentication"
Install-ModuleIfNotInstalled "Microsoft.Graph.Beta.Users"

# Logging in
Write-Host "Logging in" -ForegroundColor $CommandInfo
LoginTo-MgGraph -Scopes "Directory.ReadWrite.All"

# Constants
$CompStart = $AlyaB2BCompStart
$CompEnd = $AlyaB2BCompEnd

# =============================================================
# O365 stuff
# =============================================================

Write-Host "`n`n=====================================================" -ForegroundColor $CommandInfo
Write-Host "AAD | Prepare-GuestUsers | Graph" -ForegroundColor $CommandInfo
Write-Host "=====================================================`n" -ForegroundColor $CommandInfo

function Main
{
    Write-Host "Getting all guest accounts" -ForegroundColor $CommandInfo
    $Users = Get-MgBetauser -Filter "UserType eq 'Guest'" -All

    Write-Host "Checking $($Users.Count) accounts"
    foreach($User in $Users)
    {
        #$user = $users[20]
        Write-Host "=============================== $($user.AlternateEmailAddresses)"
        $oldUser = @{disp=$User.DisplayName;first=$User.GivenName;last=$User.Surname}
        Write-Host "OLD: $($oldUser | ConvertTo-Json -Compress)"
        #$newUser | ConvertTo-Json

        $first = $null
        $last = $null
        $disp = $null

        if ($user.UserPrincipalName.Contains("#"))
        {
            $email = $user.UserPrincipalName.Split("#")[0]
            $name = $email.Substring(0, $email.LastIndexOf("_"))
            $domain = $email.Substring($email.LastIndexOf("_")+1)
            $domainParts = $domain.Split(".")
            $comp = "$ExternalMarker " + (Make-PascalCase($domainParts[$domainParts.Length-2]))
            if ($domainParts.Length -gt 2)
            {
                $comp += " " + (Make-PascalCase($domainParts[$domainParts.Length-3]))
            }
        }
        else
        {
            $name = $user.UserPrincipalName.Split("@")[0]
            $domain = $user.UserPrincipalName.Split("@")[1]
            $domainParts = $domain.Split(".")
            $comp = Make-PascalCase($domainParts[$domainParts.Length-2])
            if ($domainParts.Length -gt 2)
            {
                $comp += " " + (Make-PascalCase($domainParts[$domainParts.Length-3]))
            }
        }
        if ($comp -eq "$ExternalMarker Outlook" -or `
            $comp -eq "$ExternalMarker Gmx" -or `
            $comp -eq "$ExternalMarker Hotmail" -or `
            $comp -eq "$ExternalMarker Hispeed" -or `
            $comp -eq "$ExternalMarker Gmail" -or `
            $comp -eq "$ExternalMarker Bluewin" -or `
            $comp -eq "$ExternalMarker Bluemail" -or `
            $comp -eq "$ExternalMarker Sunrise")
        {
            $comp = "$ExternalMarker $($domain.ToLower())"
        }

        if (-Not [String]::IsNullOrEmpty($oldUser.first) -And `
            -Not [String]::IsNullOrEmpty($oldUser.last))
        {
            $first = $oldUser.first
            $last = $oldUser.last
        }
        else 
        {
            if ($oldUser.first) {$first = $oldUser.first.ToLower()} else {$first = ""}
            if ($oldUser.last) {$last = $oldUser.last.ToLower()} else {$last = ""}
            if ($oldUser.disp -eq ($name+"@"+$domain) -or $oldUser.disp -eq $name)
            {
                $disp = ""
            }
            else
            {
                if ($oldUser.disp) {$disp = $oldUser.disp.ToLower()} else {$disp = ""}
            }
            $first = $first.Replace("ä","ae").Replace("ü","ue").Replace("ö","oe").Replace("é","e").Replace("è","e").Replace("à","a")
            $last = $last.Replace("ä","ae").Replace("ü","ue").Replace("ö","oe").Replace("é","e").Replace("è","e").Replace("à","a")
            $disp = $disp.Replace("ä","ae").Replace("ü","ue").Replace("ö","oe").Replace("é","e").Replace("è","e").Replace("à","a")

            $dispFirstLastTmp = $disp.Split()
            $dispFirstLast = @()
            $stopAdding = $false
            foreach($dispPrt in $dispFirstLastTmp)
            {
                if (-Not $stopAdding -And -Not $dispPrt.StartsWith($CompStart))
                {
                    if ($dispFirstLast -notcontains $dispPrt)
                    {
                        $dispFirstLast += $dispPrt
                    }
                }
                else
                {
                    $stopAdding = $true
                }
            }
            if ($last -eq "")
            {
                switch($dispFirstLast.Length)
                {
                    1 {
                        if ($first -ne $dispFirstLast[0])
                        {
                            $last = $dispFirstLast[0]
                        }
                      }
                    2 {
                        if ($first -ne $dispFirstLast[1])
                        {
                            $last = $dispFirstLast[1]
                        }
                      }
                    3 {
                        if ($first -ne $dispFirstLast[2])
                        {
                            $last = $dispFirstLast[2]
                        }
                      }
                }
            }
            if ($first -eq "" -and $last -ne $dispFirstLast[0])
            {
                $first = $dispFirstLast[0]
            }

            if ($name.IndexOf(".") -gt -1)
            {
                $namePrts = $name.Split(".")
            }
            else
            {
                $namePrts = $name.Split("-_")
            }
            switch($namePrts.Length)
            {
                1 {
                    if ($namePrts[0] -ne ($first+$last) -and $namePrts[0] -ne ($last+$first))
                    {
                        if ($nachnamen -contains $namePrts[0])
                        {
                            $last = $namePrts[0]
                        }
                        elseif ($vornamen -contains $namePrts[0])
                        {
                            $first = $namePrts[0]
                        }
					    else
                        {
                            if (-Not ($first -eq $namePrts[0] -and $last -eq "" -or `
                                $last -eq $namePrts[0] -and $first -eq "" -or `
                                $last -ne "" -and $first -ne ""))
                            {
                                $fndName = $false
                                foreach($nachname in $nachnamen)
                                {
                                    if ($namePrts[0].Contains($nachname))
                                    {
                                        $last = $nachname
                                        $first = $namePrts[0].Replace($nachname, "")
                                        $fndName = $true
                                        break
                                    }
                                }
                                foreach($vorname in $vornamen)
                                {
                                    if ($namePrts[0].Contains($vorname))
                                    {
                                        $first = $vorname
                                        $last = $namePrts[0].Replace($vorname, "")
                                        $fndName = $true
                                        break
                                    }
                                }
                                if ($fndName)
                                {
                                    $decision = $Host.UI.PromptForChoice("Confirm", "Is First='$($first)' Last='$($last)' correct?", @("&Yes", "&No"), 0)
                                    if ($decision -eq 1)
                                    {
                                        $fndName = $false
                                    }
                                }
                                if (-Not $fndName)
                                {
                                    $decision = $Host.UI.PromptForChoice("Confirm", "What is '$($namePrts[0])'?", @("&First", "&Last", "&None", "&Skip"), 1)
                                    if ($decision -eq 0)
                                    {
                                        $first = $namePrts[0]
                                        $last = ""
                                    }
                                    if ($decision -eq 1)
                                    {
                                        $last = $namePrts[0]
                                        $first = ""
                                    }
                                    if ($decision -eq 2)
                                    {
                                        $response  = $Host.UI.Prompt("Question", "Specify first and last for: '$($namePrts[0])'?", @("First", "Last"))
                                        $first = $response["First"]
                                        $last = $response["Last"]
                                    }
                                }
                            }
                        }
                    }
                }
                {($_ -gt 1)} {
                    switch($namePrts.Length)
                    {
                        2 {
                            $tests = @()
                            if ($first -ne "" -and $last -ne "")
                            {
                                $tests += @{
                                    "first" = $first
                                    "last" = $last
                                }
                            }
                            elseif ($first -eq "" -and $last -ne "")
                            {
                                $tests += @{
                                    "first" = $namePrts[0]
                                    "last" = $last
                                }
                                $tests += @{
                                    "first" = $namePrts[1]
                                    "last" = $last
                                }
                            }
                            elseif ($first -ne "" -and $last -eq "")
                            {
                                $tests += @{
                                    "first" = $first
                                    "last" = $namePrts[0]
                                }
                                $tests += @{
                                    "first" = $first
                                    "last" = $namePrts[1]
                                }
                            }
                            else
                            {
                                $tests += @{
                                    "first" = $namePrts[0]
                                    "last" = $namePrts[1]
                                }
                                $tests += @{
                                    "last" = $namePrts[0]
                                    "first" = $namePrts[1]
                                }
                            }

                        }
                        3 {
                            $tests = @()
                            if ($first -ne "" -and $last -ne "")
                            {
                                $tests += @{
                                    "first" = $first
                                    "last" = $last
                                }
                            }
                            elseif ($first -eq "" -and $last -ne "")
                            {
                                $tests += @{
                                    "first" = $namePrts[0]+"-"+$namePrts[1]
                                    "last" = $last
                                }
                                $tests += @{
                                    "first" = $namePrts[0]+" "+$namePrts[1]
                                    "last" = $last
                                }
                                $tests += @{
                                    "first" = $namePrts[1]+"-"+$namePrts[2]
                                    "last" = $last
                                }
                                $tests += @{
                                    "first" = $namePrts[1]+" "+$namePrts[2]
                                    "last" = $last
                                }
                                $tests += @{
                                    "first" = $namePrts[0]
                                    "last" = $last
                                }
                                $tests += @{
                                    "first" = $namePrts[1]
                                    "last" = $last
                                }
                                $tests += @{
                                    "first" = $namePrts[2]
                                    "last" = $last
                                }
                            }
                            elseif ($first -ne "" -and $last -eq "")
                            {
                                $tests += @{
                                    "first" = $first
                                    "last" = $namePrts[0]+"-"+$namePrts[1]
                                }
                                $tests += @{
                                    "first" = $first
                                    "last" = $namePrts[0]+" "+$namePrts[1]
                                }
                                $tests += @{
                                    "first" = $first
                                    "last" = $namePrts[1]+"-"+$namePrts[2]
                                }
                                $tests += @{
                                    "first" = $first
                                    "last" = $namePrts[1]+" "+$namePrts[2]
                                }
                                $tests += @{
                                    "first" = $first
                                    "last" = $namePrts[0]
                                }
                                $tests += @{
                                    "first" = $first
                                    "last" = $namePrts[1]
                                }
                                $tests += @{
                                    "first" = $first
                                    "last" = $namePrts[2]
                                }
                            }
                            else
                            {
                                $tests += @{
                                    "first" = $namePrts[0]+"-"+$namePrts[1]
                                    "last" = $namePrts[2]
                                }
                                $tests += @{
                                    "first" = $namePrts[0]
                                    "last" = $namePrts[1]+"-"+$namePrts[2]
                                }
                                $tests += @{
                                    "first" = $namePrts[0]+" "+$namePrts[1]
                                    "last" = $namePrts[2]
                                }
                                $tests += @{
                                    "first" = $namePrts[0]
                                    "last" = $namePrts[1]+" "+$namePrts[2]
                                }
                                $tests += @{
                                    "last" = $namePrts[0]+"-"+$namePrts[1]
                                    "first" = $namePrts[2]
                                }
                                $tests += @{
                                    "last" = $namePrts[0]
                                    "first" = $namePrts[1]+"-"+$namePrts[2]
                                }
                                $tests += @{
                                    "last" = $namePrts[0]+" "+$namePrts[1]
                                    "first" = $namePrts[2]
                                }
                                $tests += @{
                                    "last" = $namePrts[0]
                                    "first" = $namePrts[1]+" "+$namePrts[2]
                                }
                            }
                        }
                    }
                    $fndVorname = $null
                    $fndNachname = $null
                    foreach($test in $tests)
                    {
                        if ($vornamen -contains $test.first)
                        {
                            $first = $test.first
                            $last = $test.last.Replace("-"," ")
                            $fndVorname = $first
                            break
                        }
                        if ($nachnamen -contains $test.last)
                        {
                            $last = $test.last
                            $first = $test.first
                            $fndNachname = $last
                            break
                        }
                    }
                    if (-Not $fndVorname -and -Not $fndNachname)
                    {
                        switch($namePrts.Length)
                        {
                            2 {
                                if (($first -ne $namePrts[0] -and $last -ne $namePrts[1]) -and `
                                    ($first -ne $namePrts[1] -and $last -ne $namePrts[0]))
                                {
                                    $first = $namePrts[0]
                                    $last = $namePrts[1]
                                    $decision = $Host.UI.PromptForChoice("Confirm", "Is First='$($first)' Last='$($last)' correct?", @("&Yes", "&Swap"), 0)
                                    if ($decision -eq 1)
                                    {
                                        $tmp = $first
                                        $first = $last
                                        $last = $tmp
                                    }
                                }
                            }
                            3 {
                                if (($first -ne $namePrts[0] -and $last -ne ($namePrts[1]+" "+$namePrts[2])) -and `
                                    ($first -ne ($namePrts[0]+"-"+$namePrts[1]) -and $last -ne $namePrts[2]) -and `
                                    ($first -ne ($namePrts[0]+" "+$namePrts[1]) -and $last -ne $namePrts[2]) -and `
                                    ($last -ne $namePrts[0] -and $first -ne ($namePrts[1]+"-"+$namePrts[2])) -and `
                                    ($last -ne $namePrts[0] -and $first -ne ($namePrts[1]+" "+$namePrts[2])) -and `
                                    ($last -ne ($namePrts[0]+" "+$namePrts[1]) -and $first -ne $namePrts[2]))
                                {
                                    $first = $namePrts[0]
                                    $last = ($namePrts[1]+" "+$namePrts[2])
                                    $decision = $Host.UI.PromptForChoice("Confirm", "Is First='$($first)' Last='$($last)' correct?", @("&Yes", "&No"), 0)
                                    if ($decision -eq 1)
                                    {
                                        $first = ($namePrts[0]+" "+$namePrts[1])
                                        $last = $namePrts[2]
                                        $decision = $Host.UI.PromptForChoice("Confirm", "Is First='$($first)' Last='$($last)' correct?", @("&Yes", "&No"), 0)
                                        if ($decision -eq 1)
                                        {
                                            $first = $namePrts[2]
                                            $last = ($namePrts[0]+" "+$namePrts[1])
                                            $decision = $Host.UI.PromptForChoice("Confirm", "Is First='$($first)' Last='$($last)' correct?", @("&Yes", "&No"), 0)
                                            if ($decision -eq 1)
                                            {
                                                $first = ($namePrts[1]+" "+$namePrts[2])
                                                $last = $namePrts[0]
                                                $decision = $Host.UI.PromptForChoice("Confirm", "Is First='$($first)' Last='$($last)' correct?", @("&Yes", "&No"), 0)
                                                if ($decision -eq 1)
                                                {
                                                    $first = ($namePrts[0]+"-"+$namePrts[1])
                                                    $last = $namePrts[2]
                                                    $decision = $Host.UI.PromptForChoice("Confirm", "Is First='$($first)' Last='$($last)' correct?", @("&Yes", "&No"), 0)
                                                    if ($decision -eq 1)
                                                    {
                                                        $first = ($namePrts[1]+"-"+$namePrts[2])
                                                        $last = $namePrts[0]
                                                        $decision = $Host.UI.PromptForChoice("Confirm", "Is First='$($first)' Last='$($last)' correct?", @("&Yes", "&No"), 0)
                                                        if ($decision -eq 1)
                                                        {
                                                            throw "really?"
                                                        }
                                                    }
                                                }
                                            }
                                        }
                                    }
                                }
                            }
                        }
                    }
                    else
                    {
                        if ($fndVorname)
                        {
                            if ($namePrts.Length -gt 2)
                            {
                                if ($namePrts[0] -eq $fndVorname)
                                {
                                    if ($vornamen -contains $namePrts[1])
                                    {
                                        $first = $namePrts[0]+" "+$namePrts[1]
                                        $last = $namePrts[2]
                                    }
                                    else
                                    {
                                        $first = $namePrts[0]
                                        $last = $namePrts[1]+" "+$namePrts[2]
                                    }
                                }
                                if ($namePrts[2] -eq $fndVorname)
                                {
                                    $first = $namePrts[2]
                                    $last = $namePrts[0]+" "+$namePrts[1]
                                }
                            }
                        }
                        if ($fndNachname)
                        {
                        
                        }
                    }
                }
                default { throw "Not implemented" }
            }
            $first = Make-PascalCase -string $first
            $last = Make-PascalCase -string $last
            $firstChk = $first.Replace("ae","ä").Replace("ue","ü").Replace("oe","ö")
            if ($oldUser.disp.Contains($firstChk))
            {
                $first = $firstChk
            }
            $lastChk = $last.Replace("ae","ä").Replace("ue","ü").Replace("oe","ö")
            if ($oldUser.disp.Contains($lastChk))
            {
                $last = $lastChk
            }
        }
        $disp = ($first + " " + $last).Trim() + " " + $CompStart + $comp + $CompEnd
        if ($SurnameFirst)
        {
            $disp = ($last + " " + $first).Trim() + " " + $CompStart + $comp + $CompEnd
        }
        if ($first -eq "") {$first = $null}
        if ($last -eq "") {$last = $null}
        $newUser = @{disp=$disp;first=$first;last=$last}

        if (($oldUser | ConvertTo-Json -Compress) -ne ($newUser | ConvertTo-Json -Compress))
        {
            Write-Host "NEW: $($newUser | ConvertTo-Json -Compress)"
        
            $decision = $Host.UI.PromptForChoice("Confirm", "Update?", @("&Yes", "&SwapFirstLast", "&No", "&Stop"), 1)
            if ($decision -eq 3)
            {
                Return
            }
            if ($decision -eq 1)
            {
                $null = $first
                $first = $last
                $last = $tmp
                $disp = ($first + " " + $last).Trim() + " " + $CompStart + $comp + $CompEnd
                if ($SurnameFirst)
                {
                    $disp = ($last + " " + $first).Trim() + " " + $CompStart + $comp + $CompEnd
                }
                $newUser = @{disp=$disp;first=$first;last=$last}
                Write-Host "SWAPPED: $($newUser | ConvertTo-Json -Compress)"
                if ($null -eq $newUser.last) {
                    Update-MgBetaUser -UserId $user.Id -GivenName $newUser.first -DisplayName $newUser.disp
                    Invoke-MgBetaRestMethod -Method "Patch" -Uri "https://graph.microsoft.com/beta/users/$($user.Id)" -Body @{Surname = $null}
                }
                else {
                    if ($null -eq $newUser.first) {
                        Update-MgBetaUser -UserId $user.Id -Surname $newUser.last -DisplayName $newUser.disp
                        Invoke-MgBetaRestMethod -Method "Patch" -Uri "https://graph.microsoft.com/beta/users/$($user.Id)" -Body @{GivenName = $null}
                    }
                    else {
                        Update-MgBetaUser -UserId $user.Id -Surname $newUser.last -GivenName $newUser.first -DisplayName $newUser.disp
                    }
                }
            }
            if ($decision -eq 0)
            {
                if ($null -eq $newUser.last) {
                    Update-MgBetaUser -UserId $user.Id -GivenName $newUser.first -DisplayName $newUser.disp
                    Invoke-MgBetaRestMethod -Method "Patch" -Uri "https://graph.microsoft.com/beta/users/$($user.Id)" -Body @{Surname = $null}
                }
                else {
                    if ($null -eq $newUser.first) {
                        Update-MgBetaUser -UserId $user.Id -Surname $newUser.last -DisplayName $newUser.disp
                        Invoke-MgBetaRestMethod -Method "Patch" -Uri "https://graph.microsoft.com/beta/users/$($user.Id)" -Body @{GivenName = $null}
                    }
                    else {
                        Update-MgBetaUser -UserId $user.Id -Surname $newUser.last -GivenName $newUser.first -DisplayName $newUser.disp
                    }
                }
            }
        }
    }
}

